              <li><Link  to="/form2">Student login / signup </Link></li>
          </ul>
      </nav>
      <div className="container">
          
      </div>
      </div>
    )
  }
  return ( te ? <Navigate to ="/mainstud" /> : <F/>)
}

export default Home
